(window.webpackJsonp=window.webpackJsonp||[]).push([[915],{1747:function(module,__webpack_exports__,__webpack_require__){"use strict";__webpack_require__.r(__webpack_exports__),__webpack_exports__.default="# HeroIcons Solid\n\nThis package includes individual files for each icon, ready to be imported into a project.\n\nEach icon is in its own file, so you can bundle several icons from different icon sets without bundling entire icon sets.\n\n## Installation\n\nIf you are using NPM:\n\n```bash\nnpm install @iconify-icons/heroicons-solid --save-dev\n```\n\nIf you are using Yarn:\n\n```bash\nyarn add --dev @iconify-icons/heroicons-solid\n```\n\n## Usage with React\n\nFirst you need to install [Iconify for React](https://github.com/iconify/iconify/packages/react).\n\nIf you are using NPM:\n\n```bash\nnpm install --save-dev @iconify/react\n```\n\nIf you are using Yarn:\n\n```bash\nyarn add --dev @iconify/react\n```\n\n### Example using icon 'color-swatch' with React\n\n```js\nimport { Icon, InlineIcon } from '@iconify/react';\nimport colorSwatch from '@iconify-icons/heroicons-solid/color-swatch';\n```\n\n```jsx\n<Icon icon={colorSwatch} />\n<p>This is some text with icon adjusted for baseline: <InlineIcon icon={colorSwatch} /></p>\n```\n\n### Example using icon 'library' with React\n\nThis example is using string syntax that is available since Iconify for React 2.0\n\nThis example will not work with Iconify for React 1.x\n\n```jsx\nimport React from 'react';\nimport { Icon, addIcon } from '@iconify/react';\nimport libraryIcon from '@iconify-icons/heroicons-solid/library';\n\naddIcon('library', libraryIcon);\n\nexport function MyComponent() {\n\treturn (\n\t\t<div>\n\t\t\t<Icon icon=\"library\" />\n\t\t</div>\n\t);\n}\n```\n\n### Example using icon 'receipt-refund' with React\n\n```jsx\nimport React from 'react';\nimport { InlineIcon } from '@iconify/react';\nimport receiptRefund from '@iconify-icons/heroicons-solid/receipt-refund';\n\nexport function MyComponent() {\n\treturn (\n\t\t<p>\n\t\t\t<InlineIcon icon={receiptRefund} /> Sample text with an icon.\n\t\t</p>\n\t);\n}\n```\n\nSee https://github.com/iconify/iconify/packages/react for details.\n\n## Usage with Vue\n\nFirst you need to install [Iconify for Vue](https://github.com/iconify/iconify/packages/vue).\n\nIf you are using NPM:\n\n```bash\nnpm install --save-dev @iconify/vue\n```\n\nIf you are using Yarn:\n\n```bash\nyarn add --dev @iconify/vue\n```\n\n### Example using icon 'color-swatch' with Vue\n\nThis example is using object syntax with TypeScript.\n\n```vue\n<template>\n\t<p>\n\t\t<iconify-icon :icon=\"icons.colorSwatch\" />\n\t</p>\n</template>\n\n<script lang=\"ts\">\nimport { Component, Prop, Vue } from 'vue-property-decorator';\nimport IconifyIcon from '@iconify/vue';\nimport colorSwatch from '@iconify-icons/heroicons-solid/color-swatch';\n\nexport default Vue.extend({\n\tcomponents: {\n\t\tIconifyIcon,\n\t},\n\tdata() {\n\t\treturn {\n\t\t\ticons: {\n\t\t\t\tcolorSwatch: colorSwatch,\n\t\t\t},\n\t\t};\n\t},\n});\n<\/script>\n```\n\n### Example using icon 'library' with Vue\n\nThis example is using string syntax.\n\n```vue\n<template>\n\t<p>\n\t\tExample of 'library' icon:\n\t\t<iconify-icon icon=\"library\" :inline=\"true\" />!\n\t</p>\n</template>\n\n<script>\nimport IconifyIcon from '@iconify/vue';\nimport libraryIcon from '@iconify-icons/heroicons-solid/library';\n\nIconifyIcon.addIcon('library', libraryIcon);\n\nexport default {\n\tcomponents: {\n\t\tIconifyIcon,\n\t},\n};\n<\/script>\n```\n\n### Example using icon 'receipt-refund' with Vue\n\nThis example is using object syntax.\n\n```vue\n<template>\n\t<iconify-icon :icon=\"icons.receiptRefund\" />\n</template>\n\n<script>\nimport IconifyIcon from '@iconify/vue';\nimport receiptRefund from '@iconify-icons/heroicons-solid/receipt-refund';\n\nexport default {\n\tcomponents: {\n\t\tIconifyIcon,\n\t},\n\tdata() {\n\t\treturn {\n\t\t\ticons: {\n\t\t\t\treceiptRefund,\n\t\t\t},\n\t\t};\n\t},\n};\n<\/script>\n```\n\nSee https://github.com/iconify/iconify/packages/vue for details.\n\n## Usage with Svelte\n\nFirst you need to install [Iconify for Svelte](https://github.com/iconify/iconify/packages/svelte).\n\nIf you are using NPM:\n\n```bash\nnpm install --save-dev @iconify/svelte\n```\n\nIf you are using Yarn:\n\n```bash\nyarn add --dev @iconify/svelte\n```\n\n### Example using icon 'color-swatch' with Svelte\n\n```svelte\n<script>\n    // npm install --save-dev @iconify/svelte @iconify-icons/heroicons-solid\n    import IconifyIcon from '@iconify/svelte';\n    import colorSwatch from '@iconify-icons/heroicons-solid/color-swatch';\n<\/script>\n\n<IconifyIcon icon={colorSwatch} />\n```\n\n### Example using icon 'library' with Svelte\n\n```svelte\n<script>\n    // npm install --save-dev @iconify/svelte @iconify-icons/heroicons-solid\n    import IconifyIcon from '@iconify/svelte';\n    import libraryIcon from '@iconify-icons/heroicons-solid/library';\n<\/script>\n\n<IconifyIcon icon={libraryIcon} />\n```\n\n### Example using icon 'receipt-refund' with Svelte\n\n```svelte\n<script>\n    // npm install --save-dev @iconify/svelte @iconify-icons/heroicons-solid\n    import IconifyIcon from '@iconify/svelte';\n    import receiptRefund from '@iconify-icons/heroicons-solid/receipt-refund';\n<\/script>\n\n<IconifyIcon icon={receiptRefund} />\n```\n\nSee https://github.com/iconify/iconify/packages/svelte for details.\n\n## About HeroIcons Solid\n\nIcons author: Steve Schoger\n\nWebsite: https://github.com/refactoringui/heroicons\n\nLicense: MIT\n"}}]);